import React from 'react';

const Cart = () => {
    return (
        <div>
            <img src="/images/cart.png" alt="Cart" className="page-image" />
            <h1>Cart</h1>
            <p>Your cart is empty.</p>
        </div>
    );
};

export default Cart;
